import React from 'react';
import './.../styles/navigation/navigation.css';

class Navication extends React.Component {
    render() {
        return (
            <div className="topnav">
                <a className="active" href="/">Home</a>
                <a href="/todo">Todos</a>
                <a href="/about">About</a>
            </div>
        )
    }
}
export default Navication;
